import './Main.css';

import Main1 from '../Image/main1.jpeg';
import Main2 from '../Image/main2.jpeg';
import Main3 from '../Image/main3.jpeg';
import Main4 from '../Image/main4.jpeg';

import { Col, Container, Row } from "react-bootstrap";

function Main(){

    const ArraysOfMain = [{
        id: 1,
        image: Main1,
        uptitle: 'Charles Barrett & and others',
        title: 'Everything has beauty, but not everyone sees it.'
    },
    {
        id: 2,
        image: Main2,
        uptitle: 'Hannah Weastell & Megan Anderson',
        title: 'Being unique is better rhan being perfect'
    },
    {
        id: 3,
        image: Main3,
        uptitle: 'Hannah Weastell & Victoria West',
        title: 'I always loves aesthetics'
    },
    {
        id: 4,
        image: Main4,
        uptitle: 'Hannah Weastell and others',
        title: "You've gotta be natural"
    }];
    const ArraysOfMainOnMap = ArraysOfMain.map((ArrayOfMain) => 
    <Col key = {ArrayOfMain.id} lg = "3" md = "6">
        <div className='main-content'>
            <img src = {ArrayOfMain.image} className = "w-100 main-image"/>
            <h6 className = "main-uptitle">{ArrayOfMain.uptitle}</h6>
            <h3 className = "main-title">{ArrayOfMain.title}</h3>
        </div>
    </Col>
    )

    return(
        <Container fluid>
            <div className = "main-wrapper">
                <Row className = "g-1">
                    {ArraysOfMainOnMap[0]}
                    {ArraysOfMainOnMap[1]}
                    {ArraysOfMainOnMap[2]}
                    {ArraysOfMainOnMap[3]}
                </Row>
            </div>
        </Container>
    )
}
export default Main
